(function() {
    'use strict';
                var sy = true;
                // 控制是否静音视频的变量
                var shouldDelayElse = false;
                // 控制是否应该延迟执行else块的变量
                
                var isSp = true;

                function tiao() {
                    try {
                        var titleElement = document.querySelector(".title.active");
                        var title = titleElement ? titleElement.innerText : '';

                        if (titleElement && (title.lastIndexOf("") > 3 || isVideoFinished())) {
                            console.log("开始跳过这个任务：", title);
                            document.querySelector(".next").click();
                        } else {
                            // 如果需要延迟执行else块，则设置setTimeout
                            if (shouldDelayElse) {
                                shouldDelayElse = false;
                                // 重置标志，避免重复设置定时器
                                setTimeout(function() {
                                    if(isSp && document.querySelector(".testDetail_j").children[1] != null) {
                                        document.querySelector(".testDetail_j").children[1].click();
                                        isSp = false;
                                    }
                                    var videoElement = document.querySelector("video");
                                    if (videoElement) {
                                        videoElement.play();
                                        if (sy) {
                                            document.querySelector(".xt_video_player_common_icon").click();
                                            sy = false;
                                            // 播放后不再静音
                                        }
                                        console.log("开始播放视频：", title);
                                    }
                                }, 2000);
                                // 延迟2秒执行
                            } else {
                                // 如果不需要延迟，则直接执行else块中的代码（例如，静音操作）
                                if (sy) {
                                    document.querySelector(".xt_video_player_common_icon").click();
                                    sy = false;
                                    // 静音操作后不再执行
                                }
                            }
                            shouldDelayElse = true;
                            // 设置标志，以便下一次调用时延迟执行else块
                        }
                    } catch (error) {
                        console.log("发生了错误，无法播放：", error, title);
                        console.log("开始跳过这个任务：", title);
                        document.querySelector(".next").click();
                    }
                }

                // 定义一个函数来检查视频是否播放完毕
                function isVideoFinished() {
                    var currentTimeElement = document.querySelector(".xt_video_player_current_time_display");

                    if (currentTimeElement == null) {
                        // 如果找不到相关元素，则假设视频没有播放完毕
                        return false;
                    }

                    var currentTime = currentTimeElement.firstChild.innerText;
                    var durationTime = currentTimeElement.lastElementChild.innerText;

                    // 检查当前时间是否等于总时长
                    return timeStringToMilliseconds(durationTime) - timeStringToMilliseconds(currentTime) <= 4000
                }

                function timeStringToMilliseconds(timeString) {
                    // 分割时间字符串为小时、分钟和秒
                    var parts = timeString.split(':');

                    // 确保分割后有三个部分
                    if (parts.length !== 3) {
                        throw new Error('Invalid time string format. Expected format: HH:MM:SS');
                    }

                    // 将每个部分转换为整数
                    var hours = parseInt(parts[0], 10);
                    var minutes = parseInt(parts[1], 10);
                    var seconds = parseInt(parts[2], 10);

                    // 转换为毫秒并累加
                    var milliseconds = (hours * 60 * 60 * 1000) + (minutes * 60 * 1000) + (seconds * 1000);

                    return milliseconds;
                }

                // 每2秒调用一次tiao函数
                setInterval(tiao, 2000);
})();